@EU_Commission @EUCouncil @Europarl_EN 

Please offer supranational guidance for #COVID19 testing. Aggressive testing is either life saying and necessary to combat pandemic (per WHO), or it "has no basis" as leaders in some countries (Croatia, Finland..?) suggest. 

Thank you.

@EU_Commission's Ivo Volman at @CYBERSECEU: 

"the data strategy is not against organizations and countries outside Europe, it is about how we want to organize things inside Europe (...) we want it accordingly to our values"

#CSBXL20 #
